import '../css/Classroom.css'
import ClassroomItem from './ClassroomItem'

function ClassroomList() {
    let items = [1,2,3]

    return (
        <div>
            {items.map( (item, index) => {
                return (
                    <>
                        <ClassroomItem/>
                        <BorderLine/>
                    </>
                )
            })}
        </div>
    )
}

export default ClassroomList
